import React from "react";
import image from "../download.jpg";

function Header() {
  return (
    <header>
      <h1>Keeper</h1>
      <a
        href="#"
        class="btn-hover-effect btn-hover-effect--effect-3"
        title="View More"
      >
        View More
      </a>
      <img src={image} alt="Avatar"></img>
    </header>
  );
}

export default Header;
